<!DOCTYPE html>
<html lang="en">
<head>

<body>
    <script>
        let datos = ["hola", "mandaria", "casa"];
        
        // Ejemplo for in
        for (let i in datos) {
            console.log(datos[i]);
        }

        // Ejemplo for for
        for (let elemento of datos) {
            console.log(elemento);
        }
    </script>
